import Reminders from "../models/reminders";

interface ReminderListProps {
  items: Reminders[];
}

const RemindersList = ({ items }: ReminderListProps) => {
  return (
    <ul className="list-group">
      {items.map((item) => (
        <li className="list-style-item" key={item.id}>
          {item.title}
        </li>
      ))}
    </ul>
  );
};

export default RemindersList;
